import React from 'react';
import styled from 'styled-components';
import logo from '../assets/color_logo.png'
import Input from "./Input";

const InitialInputPane = () => {
    return (
        <Container>
            <LogoWrapper>
                <img src={logo} alt=""/>
                <h3>
                bounded.supply
                </h3>
            </LogoWrapper>
            <Form>
                <h3>Seller Portal</h3>
                <h3>List Collectible to Bounded F21</h3>
                <Input placeholder="Item Name"/>
                <Input placeholder="Token Symbol"/>
                <Input placeholder="Units Available"/>
                <Input placeholder="Network"/>

                <h3>Item Name</h3>
                <h3>Token Symbol</h3>
                <h3>Units Available</h3>
                <h3>Network</h3>
                <select name="Deployment Network" id="networks">
                    <option value="mainnet">Ethereum Main Network</option>
                    <option value="ropsten">Ropsten Test Network</option>
                    <option value="rinkeby">Rinkeby Test Network</option>
                    <option value="kovan">Kovan Test Network</option>
                    <option value="goerli">Goerli Test Network</option>
                </select>
                <h3>Deployment Fee</h3>
            </Form>
        </Container>
    )
}

const Form = styled.form`
    width : 100%;
    display: flex;
    flex-direction: column;
    align: center;

    h3 {
        font-weight: 400;
        margin-bottom: 1rem;
        text-align: center;
    }
    select {
        margin-bottom: 2rem;

        display: block;
        margin-left: auto;
        margin-right: auto;
    }
`;

const LogoWrapper = styled.div`
img {
    height: 3rem;
    display: block;
    margin-left: auto;
    margin-right: auto;
}

h3 {
    text-align: center;
    font-weight: 300;
    font-size: 18px
}
`;

const Container = styled.div`
    width : 80%;
    margin: 0 auto;
    backdrop-filter : blur(135px);
    background-color : rgba(255, 255, 255, 0.1);
    height: 100%; 
    display: flex;
    flex-direction: column;
    justify-content: space-evenly;
    align-items: center;
    padding: 0 2rem;

    @media (max-width : 900px) {
        width: 100vw;
        position: absolute;
        padding: 0;
    }
`;

export default InitialInputPane;
